import React, { Component } from "react";
import waterBillLogo from "../img/Ab-o-Fazelab-01.svg";
class WaterBill extends Component {
  state = {};
  render() {
    return (
      <div className=" col-lg-10">
        <div className="water-bg p-3">
          <div className="bill-hea"></div>
        </div>
      </div>
    );
  }
}

export default WaterBill;
